tables.table_schema:
CREATE TABLE golf_course_weather_data (
  course_id INT,
  date DATE,
  temperature FLOAT,
  precipitation FLOAT
);

CREATE TABLE golf_course_weather_data (
    course_id UUID PRIMARY KEY,
    date DATE,
    temperature FLOAT,
    humidity FLOAT
);

CREATE TABLE golf_course_info (
    course_id UUID PRIMARY KEY,
    course_name VARCHAR(255),
    location VARCHAR(255),
    address VARCHAR(255),
    architect VARCHAR(255)
);

CREATE TABLE golf_courses (
    id INT PRIMARY KEY,
    course_name TEXT,
    location TEXT
);

CREATE TABLE GolfCourses (
    id INT PRIMARY KEY,
    course_name TEXT,
    location TEXT
);

CREATE TABLE TeeTimes (
    tee_time_id INT PRIMARY KEY,
    golf_course_id INT,
    date DATE,
    time TIME
);

CREATE TABLE Players (
    player_id INT PRIMARY KEY,
    player_name TEXT,
    handicap DECIMAL
);
